const Movie = () => {
    return (
      <Col ks="6" md="4" sm="6" lg="3">
        <Card className="bg-dark text-white my-4 ">
          <Card.Img className="" src="logo192.png" alt="Card image" />
          <Card.ImgOverlay>
           <p>اسم الفلم : المصلحة</p>
           <p>تاريخ الاصدا</p>
           <p></p>
           <p></p>
          </Card.ImgOverlay>
        </Card>
      </Col>
    );
    
}
export default Movie
